INSERT INTO `article` (`idArticle`, `idMembre`, `idSerie`, `titre`, `contenu`, `image`, `dateCreation`) VALUES
(2, 3, 1, 'Agents du S.H.I.E.L.D. : les héros prennent la pose avant le lancement de la saison 5', 'A quelques jours du lancement de leur cinquième saison, les Agents du S.H.I.E.L.D. font le plein de nouvelles images. Après les 17 premières minutes dévoilées hier, place aujourd\'hui à une salve de photos, sur laquelle les héros prennent la pose.\r\nRappelons qu\'à la fin de la saison 4, l\'équipe de Coulson se retrouve propulsée dans l\'espace à bord d\'un vaisseau. Le début d\'un long cauchemar pour les Agents... Lancement de la saison 5 vendredi sur ABC ! 			', , '2018-02-19 22:15:45');
INSERT INTO `article` (`idArticle`, `idMembre`, `idSerie`, `titre`, `contenu`, `image`, `dateCreation`) VALUES
(1, 3, 2, 'Les désastreuses aventures des orphelins Baudelaire : un teaser délicieusement épouvantable pour la saison', '\"Le mieux est parfois l\'ennemi du bien. Au point d\'être bien pire. Le 30 mars, attendez-vous à plus de méchants, de perfides machinations, de périls, d\'orphelins et d\'incendies volontaires. \" Tel est le programme de la saison 2 des Désastreuses aventures des orphelins Baudelaire, la série Netflix adaptée des romans de Daniel Handler. Le teaser nous offre une petite mise en bouche avec nos trois héros qui tentent d’échapper tant bien que mal aux pièges du terrible comte Olaf (Neil Patrick Harris). Et surtout, il nous dévoile la première image de Nathan Fillion (Castle) qui, selon les rumeurs, pourrait camper le père du narrateur Lemony Snicket.\r\n\r\nLa saison 2 des orphelins Baudelaire, qui risque d’être l’avant-dernière, couvrira quatre nous romans allant de \"Pièce au collège\" à \"La Fête Féroce\". Après un petit tour à l’internat – où nous découvrirons le personnage de Monsieur Nero, Violette, Klaus et Prunille nous emmèneront au cirque pour de nouveaux gags… burlesques.\r\n\r\nLes nouveaux épisodes seront à binge-watcher dès le 30 mars sur Netflix.									', , '2018-02-15 14:35:27');

