(1, 1, 1, 'The Bad Beginning: Part One', 'Tout commence mal... : Partie 1', 'After their parents perish in a fire that destroys their entire home, the Baudelaire orphans are sent to live with Count Olaf, who claims to be their distant relative and a renowned actor.', NULL, '2017-01-13'),
(2, 1, 2, 'The Bad Beginning: Part Two', 'Tout commence mal... : Partie 2', 'The Baudelaire orphans try and escape the grasp of the evil Count Olaf.', NULL, '2017-01-13'),
(3, 1, 3, 'The Reptile Room: Part One', 'Le laboratoire aux serpents : Partie 1', 'After finally escaping Count Olaf\'s clutches the Baudelaires are sent to live with their kind Uncle. All their troubles seem to be over until an unexpected guest arrives.', NULL, '2017-01-13'),
(4, 1, 4, 'The Reptile Room: Part Two', 'Le laboratoire aux serpents : Partie 2', 'The Baudelaires are in a compromising position when Uncle Monty is discovered dead in the Reptile Room.', NULL, '2017-01-13'),
(5, 1, 5, 'The Wide Window: Part One', 'Ouragan sur le lac : Partie 1', 'After escaping Count Olaf again the Baudelaires go to live with their superstitious Aunt Josephine.', NULL, '2017-01-13'),
(6, 1, 6, 'The Wide Window: Part Two', 'Ouragan sur le lac : Partie 2', 'The Baudelaires are stunned to find Aunt Josephine\'s suicide note, but quickly find everything about the circumstances highly suspicious.', NULL, '2017-01-13'),
(7, 1, 7, 'The Miserable Mill: Part One', 'Cauchemar à la scierie : Partie 1', 'The orphans are shipped off to work in a miserable mill with a distant relative who has a complicated name and pays his employees with sandwich tokens.', NULL, '2017-01-13'),
(8, 1, 8, 'The Miserable Mill: Part Two', 'Cauchemar à la scierie : Partie 2', 'Klaus continues acting strangely following his optometry appointment, leading the Baudelaires to discover the dark truth behind the Lucky Smells Lumbermill.', NULL, '2017-01-13');

