INSERT INTO `serie` (`idSerie`, `titre`, `titre_fr`, `description`, `description_fr`, `image`, `fini`) VALUES
(1, 'Agents of S.H.I.E.L.D.', 'Marvel : Les Agents du SHIELD', 'The missions of the Strategic Homeland Intervention, Enforcement and Logistics Division!																												', 'Après de longs mois de repos à la suite de sa blessure infligée par le légendaire dieu Loki pendant l&#39;invasion de New York, l&#39;agent Phil Coulson réintègre le SHIELD, une organisation internationale qui enquète sur les phénomènes paranormaux et défend la terre des menaces terroristes ou d&#39;invasions extra-terrestre.																														', , 0);
INSERT INTO `serie` (`idSerie`, `titre`, `titre_fr`, `description`, `description_fr`, `image`, `fini`) VALUES
(2, 'A Series of Unfortunate Events', 'Les Désastreuses Aventures des orphelins Baudelaire', 'When a massive fire kills their parents, three children are delivered to the custody of cousin and stage actor Count Olaf, who is secretly plotting to steal their parents\' vast fortune.', 'À la suite de l\'incendie du manoir Baudelaire et de la mort de leurs parents, Violette, Klaus, et Prunille se retrouvent orphelins.\r\n\r\nMonsieur Arthur Poe, le directeur de la banque où est entreposée la grande richesse de la famille, est donc chargé de confier les enfants au parent le plus proche de Monsieur et Madame Baudelaire : le comte Olaf, un sinistre acteur égoïste et vantard, qui ne cherche qu\'à se débarrasser des enfants et mettre la main sur leur fortune familiale.\r\n\r\nLes trois enfants vont devoir traverser différentes aventures dans l\'espoir d’empêcher la réussite du diabolique comte mais aussi pour sauver leurs vies, constamment en danger.', , 0);
INSERT INTO `serie` (`idSerie`, `titre`, `titre_fr`, `description`, `description_fr`, `image`, `fini`) VALUES
(3, 'Breaking Bad', 'Breaking Bad', 'A high school chemistry teacher diagnosed with inoperable lung cancer turns to manufacturing and selling methamphetamine in order to secure his family\'s future.', 'Walter « Walt » White est professeur de chimie dans un lycée, et vit avec son fils handicapé et sa femme enceinte à Albuquerque, au Nouveau-Mexique. Lorsqu\'on lui diagnostique, peu après qu\'il a fêté ses 50 ans, un cancer du poumon en phase terminale avec une espérance de vie estimée à deux ans, tout s\'effondre pour lui. Il décide alors de mettre en place un laboratoire et un trafic de méthamphétamine pour assurer un avenir financier confortable à sa famille après sa mort, en s\'associant à Jesse Pinkman, un de ses anciens élèves devenu petit trafiquant.', , 1);
INSERT INTO `serie` (`idSerie`, `titre`, `titre_fr`, `description`, `description_fr`, `image`, `fini`) VALUES
(4, 'The Witcher', 'The Witcher', 'Chronicles monster hunters who, with training and body modification, develop supernatural abilities to battle deadly beasts.', NULL, , 0);
INSERT INTO `serie` (`idSerie`, `titre`, `titre_fr`, `description`, `description_fr`, `image`, `fini`) VALUES
(5, 'Rick and Morty', 'Rick et Morty', 'An animated series that follows the exploits of a super scientist and his not-so-bright grandson.									', 'Rick Sanchez est un scientifique âgé qui a récemment renoué avec sa famille. Il passe le plus clair de son temps à entraîner son petit-fils Morty dans des aventures extraordinaires et dangereuses, à travers l&#39;espace et les univers parallèles. Ajoutés à la vie de famille déjà instable de Morty, ces évènements ne lui amènent qu&#39;un surplus de stress, à la maison et au collège.									', , 0);

