(136, '_transient_feed_76f8d9281c01f21e505004d0986f50c6', 'a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:5:\"\n		\n	\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:79:\"\n		\n		\n		\n		\n		\n		\n					\n						\n						\n						\n						\n						\n						\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Planète WordPress Francophone\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"https://wpfr.net/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Toute l’actualité de WordPress en français !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"fr-FR\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:8:{i:0;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Be Happy au WordCamp Paris 2018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://feedproxy.google.com/~r/wpfr/~3/KvpFROyU7HA/wcparis-2018-beapi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"http://blog.beapi.fr/wcparis-2018-beapi\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 19 Mar 2018 08:21:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:188:\"\n		        La team BeAPI vous fait son retour sur cette 10ème édition du WordCamp Paris.\nCet article Be Happy au WordCamp Paris 2018 est apparu en premier sur Be API Tech blog.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6500:\"<p>La team <a href=\"https://beapi.fr/\">BeAPI</a> était massivement présente (comme d&rsquo;habitude ^^) à cette édition du <strong><a href=\"https://2018.paris.wordcamp.org\">WordCamp Paris</a></strong> en tant que sponsor et orateur.</p>\n<p><span id=\"more-494\"></span>Ce fut une édition spéciale pour fêter les 10 ans de l&rsquo;événement :</p>\n<p><img class=\"aligncenter size-full wp-image-509\" src=\"https://i0.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/wcparis-2018-cake.gif?resize=660%2C478\" alt=\"\" width=\"660\" height=\"478\" /></p>\n<p>On notera que pour l&rsquo;occasion, Julio avait sorti le costume :</p>\n<p><img class=\"aligncenter size-full wp-image-513\" src=\"https://i0.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7152.jpg?resize=660%2C440\" alt=\"\" width=\"660\" height=\"440\" /></p>\n<h2>BeAPI orateur au WordCamp Paris</h2>\n<p>N&rsquo;en déroge pas à la règle, BeAPI fut représenté par Amaury Balmer et Bilal Sebaa en tant qu&rsquo;orateur. Ils ont respectivement animé une conférence et un atelier ainsi que l&rsquo;open bar.</p>\n<h3><a class=\"wcpt-session-title\" href=\"https://2018.paris.wordcamp.org/session/et-si-on-passer-en-revue-les-points-faibles-de-wordpress/\">Et si on passait en revue les points faibles de WordPress ? (Amaury Balmer)</a></h3>\n<p><img class=\"aligncenter size-full wp-image-512\" src=\"https://i1.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7110.jpg?resize=660%2C437\" alt=\"\" width=\"660\" height=\"437\" /></p>\n<p></p>\n<h3><a class=\"wcpt-session-title\" href=\"https://2018.paris.wordcamp.org/session/laudit-seo-dun-site-wordpress-step-by-step/\">L’audit SEO d’un site WordPress en mode pas à pas. (Bilal Sebaa)</a></h3>\n<p><img class=\"aligncenter size-full wp-image-507\" src=\"https://i0.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7164.jpg?resize=660%2C452\" alt=\"\" width=\"660\" height=\"452\" /></p>\n<h3 class=\"entry-title\"><a href=\"https://2018.paris.wordcamp.org/session/suivi-analytics-des-sites-wordpress/\">Suivi analytics des sites WordPress ( Bilal Sebaa)</a></h3>\n<p><img class=\"aligncenter size-full wp-image-510\" src=\"https://i0.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7083.jpg?resize=660%2C405\" alt=\"\" width=\"660\" height=\"405\" /></p>\n<p><em>PS: ne cherchez pas le support d&rsquo;atelier et de la conférence de Bilal, il a principalement fait du live. Néanmoins soyez à l&rsquo;écoute, car il va rédiger et partager une série d&rsquo;articles sur notre blog concernant ces sujets.</em></p>\n<h2>BeAPI sponsor au WordCamp Paris</h2>\n<p>Cette année nous avons été sponsor OR et vous avez pu nous retrouver à notre stand. Le roulement des 13 membres présents a été assez fluide pour que ce ne soit pas toujours les mêmes visages au stand :</p>\n\n<a href=\'http://blog.beapi.fr/wcparis-2018-beapi/img_7064\'><img width=\"300\" height=\"186\" src=\"https://i2.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7064.jpg?fit=300%2C186\" class=\"attachment-medium size-medium\" alt=\"\" /></a>\n<a href=\'http://blog.beapi.fr/wcparis-2018-beapi/img_7040\'><img width=\"300\" height=\"174\" src=\"https://i0.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/IMG_7040.jpg?fit=300%2C174\" class=\"attachment-medium size-medium\" alt=\"\" /></a>\n\n<p>Surtout que nous vous y attendions à bras ouverts :</p>\n<p><img class=\"aligncenter size-full wp-image-516\" src=\"https://i1.wp.com/blog.beapi.fr/wp-content/uploads/2018/03/beapi-goodies.jpg?resize=660%2C660\" alt=\"\" width=\"660\" height=\"660\" /></p>\n<p>Ce fût donc l&rsquo;occasion de vous en dire plus concernant le recrutement, de vous partager notre savoir-faire en répondant à vos questions, vous accompagner et guider sur un futur projet ou tout simplement échanger sur l&rsquo;avenir de WordPress.</p>\n<h2>Différentes ressources du WordCamp Paris</h2>\n<p>Retrouvez la <a href=\"https://2018.paris.wordcamp.org/livestream/le-direct-des-conferences/\">rediffusion</a> des conférences et ateliers : <a href=\"https://2018.paris.wordcamp.org/livestream/le-direct-des-conferences/\">https://2018.paris.wordcamp.org/livestream/le-direct-des-conferences</a></p>\n<p>Mais également les slides des autres participants :</p>\n<ul>\n<li>Riad Benguella : <a href=\"https://riad.blog/2018/03/09/mon-premier-wordcamp-en-tant-que-speaker/\"><span class=\"j-title-breadcrumb\">Gutenberg, Le futur de la création de contenu dans WordPress</span></a></li>\n<li><span class=\"j-title-breadcrumb\">Claire Bizingre : </span><span class=\"j-title-breadcrumb\"><a href=\"https://www.slideshare.net/accesbilis/accessibilit-numrique-comment-la-prendre-en-compte-dans-vos-projets-wordpress\">Accessibilité numérique : comment la prendre en compte dans vos projets WordPress</a></span></li>\n<li>Maxime Bernard-Jacquet : <a href=\"https://docs.google.com/presentation/d/1YG_PAcbX8TWoWsm2GuBJT2VttA6fxpaA3CbTcyAzEZs/edit#slide=id.g3322c67485_0_127\"><span style=\"font-weight: 400\">Simplifiez le développement de vos thèmes avec Gulp</span></a></li>\n<li><span class=\"j-title-breadcrumb\">Frederique Game : </span><span class=\"j-title-breadcrumb\"><a href=\"https://fr.slideshare.net/FrederiqueGame/je-code-tu-codes-nous-codons-et-le-code-civil-dans-tout-a-confrence-wordcamp-paris-2018\">Je code, tu codes, nous codons&#8230; et le code civil dans tout ça ?</a></span></li>\n</ul>\n<p>Puis les photos :</p>\n<ul>\n<li>Flickr BeAPI : <a href=\"https://www.flickr.com/photos/beapi/albums/72157693702718404\">https://www.flickr.com/photos/beapi/albums/72157693702718404</a></li>\n<li>Flickr WordCamp Paris : <a href=\"https://www.flickr.com/groups/wordcampparis/\">https://www.flickr.com/groups/wordcampparis</a></li>\n</ul>\n<h2>Remerciements</h2>\n<p>Pour finir, nous remercions les organisateurs, les bénévoles, les orateurs, les sponsors mais également les participants. Sans tout ce monde, cet événement n&rsquo;aurait jamais eu lieu.</p>\n<p>A l&rsquo;année prochaine !</p>\n<hr />\n<p><em>N&rsquo;hésitez pas à nous dire dans les commentaires ce que vous avez pensé de cette 10ème édition de ce WordCamp Paris. Si vous avez des ressources de slides supplémentaires ou photos. Mais également faire un feedback (positif comme négatif) aux conférences d&rsquo;Amaury et de Bilal, ça leur fera plaisir ;)</em></p>\n<p>Cet article <a rel=\"nofollow\" href=\"http://blog.beapi.fr/wcparis-2018-beapi\">Be Happy au WordCamp Paris 2018</a> est apparu en premier sur <a rel=\"nofollow\" href=\"http://blog.beapi.fr\">Be API Tech blog</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/KvpFROyU7HA\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"http://blog.beapi.fr/wcparis-2018-beapi\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"Comment ajouter un fil d’Ariane sur WordPress &amp; pourquoi c’est important ?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/-fkzpAWqMNQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wpformation.com/fil-ariane-breadcrumb-wordpress/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 19 Mar 2018 07:42:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:585:\"\n		        À quand remonte la dernière fois où vous avez utilisé un fil d’Ariane pour retrouver votre chemin ? Et dans quel contexte ? Très probablement sur le net, et de manière si instinctive que vous vous en êtes à peine rendu compte. Cet outil bien pratique permet de savoir en un clin d’œil où vous vous trouvez [&#8230;]\n\nL’article Comment ajouter un fil d’Ariane sur WordPress &#038; pourquoi c’est important ? est apparu en premier sur WPFormation. Tutoriels WordPress, Formation WordPress, Woocommerce, SEO. Abonnez-vous pour ne rien manquer !\n		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"WP Formation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1422:\"<p><img width=\"1920\" height=\"1280\" src=\"https://wpformation.com/wp-content/uploads/2018/03/yarn-3219436_1920.jpg\" class=\"attachment-Large size-Large wp-post-image\" alt=\"fil ariane breadcrumb\" style=\"margin-left: 0px;margin-right: auto;margin-top:10px;margin-bottom:10px;max-width: 640px;max-height: 400px\" />À quand remonte la dernière fois où vous avez utilisé un fil d’Ariane pour retrouver votre chemin ? Et dans quel contexte ? Très probablement sur le net, et de manière si instinctive que vous vous en êtes à peine rendu compte. Cet outil bien pratique permet de savoir en un clin d’œil où vous vous trouvez [&#8230;]</p>\n<hr />\nL’article <a rel=\"nofollow\" href=\"https://wpformation.com/fil-ariane-breadcrumb-wordpress/\">Comment ajouter un fil d’Ariane sur WordPress &#038; pourquoi c’est important ?</a> est apparu en premier sur <a href=\"https://wpformation.com/\">WPFormation</a>.<br /> <a href=\"https://wpformation.com/wordpress/\">Tutoriels WordPress</a>, <a href=\"https://wpformation.com/formation-wordpress/\">Formation WordPress</a>, <a href=\"https://wpformation.com/formation-woocommerce-e-commerce/\">Woocommerce</a>, <a href=\"https://wpformation.com/formation-wordpress-pro/\">SEO</a>. <a href=\"https://wpformation.com/abonnement-newsletter-wpf/\">Abonnez-vous</a> pour ne rien manquer !</p>\n<hr /><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/-fkzpAWqMNQ\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wpformation.com/fil-ariane-breadcrumb-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Découvrir Gutenberg dès maintenant\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/Gj9zaRvIhz8/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://dfarnier.fr/decouvrir-gutenberg/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Mar 2018 08:21:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:351:\"\n		        \"Gutenberg\" est le nom du nouvel éditeur d\'article de WordPress. Il fonctionne avec des blocs (de textes, d\'images...) que l\'on positionne dans la page éditée.\nUne extension permet de se familiariser avec son mode de fonctionnement.\nCet article Découvrir Gutenberg dès maintenant est apparu en premier sur Débuter WordPress.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Daniel Farnier\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:561:\"<p>\"Gutenberg\" est le nom du nouvel éditeur d\'article de WordPress. Il fonctionne avec des blocs (de textes, d\'images...) que l\'on positionne dans la page éditée.</p>\n<p>Une extension permet de se familiariser avec son mode de fonctionnement.</p>\n<p>Cet article <a rel=\"nofollow\" href=\"https://dfarnier.fr/decouvrir-gutenberg/\">Découvrir Gutenberg dès maintenant</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://dfarnier.fr\">Débuter WordPress</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/Gj9zaRvIhz8\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"https://dfarnier.fr/decouvrir-gutenberg/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Salon WPNDIGITAL : Site web et billetterie ouverts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/6Yg672d_xDo/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://www.wpnormandie.fr/salon-wpndigital-site-web-et-billetterie-ouverts/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Mar 2018 07:31:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:375:\"\n		        Les choses s’accélèrent autour du salon WPNDigital. En effet, le site internet a ouvert vendredi dernier et avec la billetterie. Pour rappel WPNDigital est le premier salon en France à aborder les trois thématiques suivantes dans un même événement : le Web, le digital, WordPress. Il se déroulera le 2 juin 2018 au centre de congrès [&#8230;]		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:445:\"Les choses s’accélèrent autour du salon WPNDigital. En effet, le site internet a ouvert vendredi dernier et avec la billetterie. Pour rappel WPNDigital est le premier salon en France à aborder les trois thématiques suivantes dans un même événement : le Web, le digital, WordPress. Il se déroulera le 2 juin 2018 au centre de congrès [&#8230;]<img src=\"http://feeds.feedburner.com/~r/wpfr/~4/6Yg672d_xDo\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://www.wpnormandie.fr/salon-wpndigital-site-web-et-billetterie-ouverts/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Forcer la désindexation de pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://feedproxy.google.com/~r/wpfr/~3/T6D3Pa-pD9E/forcer-la-desindexation-de-pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://blog.beapi.fr/forcer-la-desindexation-de-pages\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 12 Mar 2018 11:35:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:221:\"\n		        Pour désindexer une page, une simple restriction 403 ne résout pas le problème, il faut forcer un code 410.\nCet article Forcer la désindexation de pages est apparu en premier sur Be API Tech blog.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3341:\"<header class=\"hkb-article__header\">\n<p class=\"hkb-article__title\">Si un environnement de dev/qualif/preprod est indexé par les moteurs de recherche, une simple restriction (403) ne résoud le problème que partiellement.</p>\n</header>\n<div class=\"hkb-article__content\">\n<p>En effet, les robots ne pourront plus accéder aux pages mais elles resteront dans l’index (donc interrogées régulièrement).</p>\n<p><span id=\"more-483\"></span></p>\n<h2 class=\"hkb-article__title\">Renvoyer des 410 afin de désindexer des pages</h2>\n<p>Pour indiquer aux moteurs de recherche que ces pages sont à désindexer, le moyen le plus rapide c’est de renvoyer des 410. Ce code indique qu’une ressource qui était disponible auparavant ne l’est plus actuellement.</p>\n<div class=\"code-embed-wrapper\"> <pre class=\"language-bash code-embed-pre\"><code class=\"language-bash code-embed-code\">RewriteEngine On\nRewriteCond %{HTTP_USER_AGENT} Googlebot [OR]\nRewriteCond %{HTTP_USER_AGENT} AdsBot-Google [OR]\nRewriteCond %{HTTP_USER_AGENT} msnbot [OR]\nRewriteCond %{HTTP_USER_AGENT} AltaVista [OR]\nRewriteCond %{HTTP_USER_AGENT} Slurp\nRewriteRule . - [G,L]</code></pre> <div class=\"code-embed-infos\"> <a href=\"https://github.com/BeAPI/bea-sample/blob/master/.htaccess-410\" title=\"Afficher .htaccess-410\" target=\"_blank\" class=\"code-embed-name\">.htaccess-410</a> <a href=\"https://raw.github.com/BeAPI/bea-sample/master/.htaccess-410\" title=\"Back to .htaccess-410\" class=\"code-embed-raw\" target=\"_blank\">affichage brut</a> </div> </div>\n<p>Pour cibler des pages en particulier, suivre l’exemple ci-dessous.</p>\n<div class=\"code-embed-wrapper\"> <pre class=\"language-bash code-embed-pre\"><code class=\"language-bash code-embed-code\">RewriteRule ^/wp-content/uploads/2017/01/CV_RF-Continue.pdf$ - [G,NC]\nRewriteRule ^/wp-content/uploads/2017/01/CV.pdf$ - [G,NC]\nRewriteRule ^/wp-content/uploads/2017/01/LM.pdf$ - [G,NC]\nRewriteRule ^/wp-content/uploads/2016/11/lettre_motivation_XT.pdf$ - [G,NC]\nRewriteRule ^/wp-content/uploads/2016/07/201606-CV-FR-v1.pdf$ - [G,NC]</code></pre> <div class=\"code-embed-infos\"> <a href=\"https://github.com/BeAPI/bea-sample/blob/master/.htaccess-410-precise\" title=\"Afficher .htaccess-410-precise\" target=\"_blank\" class=\"code-embed-name\">.htaccess-410-precise</a> <a href=\"https://raw.github.com/BeAPI/bea-sample/master/.htaccess-410-precise\" title=\"Back to .htaccess-410-precise\" class=\"code-embed-raw\" target=\"_blank\">affichage brut</a> </div> </div>\n<h2>Conclusion</h2>\n<header class=\"hkb-article__header\">\n<p class=\"hkb-article__title\">Une simple restriction 403 ne résout pas le problème, il faut forcer un code 410.</p>\n</header>\n<p><em>Bonus :</em> Plusieurs tests internes démontrent qu’au bout de 2 semaines, les URLs commencent à disparaître du moteur de recherche contre 6 mois environ quand du 403 est renvoyé !</p>\n<p>Enjoy !</p>\n</div>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p><!--more--></p>\n<p>Cet article <a rel=\"nofollow\" href=\"http://blog.beapi.fr/forcer-la-desindexation-de-pages\">Forcer la désindexation de pages</a> est apparu en premier sur <a rel=\"nofollow\" href=\"http://blog.beapi.fr\">Be API Tech blog</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/T6D3Pa-pD9E\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://blog.beapi.fr/forcer-la-desindexation-de-pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"Simplifiez le développement de vos thèmes avec Gulp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";